import React, { useState } from 'react';


export default function Popup(props) {
    // const {shouldOpenMyDiv, setShouldOpenMyDiv} = useState(props);

    const OnSelect = () => {
        // setShouldOpenMyDiv(false);
        props.shouldOpenMyDiv = false;
    }
    return (
        <button className="" onClick={() => OnSelect()}>
            {/* <button className=""> */}
            Hi
        </button>
    );
}
// export default Popup;
